(27, 4, 1, 12, 'Persiapan Lahan, Bedengan, Mulsa, dan Ajir', 'Test English', 'persiapan-lahan-bedengan-mulsa-dan-ajir', NULL, '<p>Sebagai bagian dari persiapan lahan sebelum melakukan pindah tanam, ada beberapa hal yang harus kamu persiapkan untuk menciptakan ruang tumbuh kembang yang baik bagi tanaman budidaya. Di antaranya adalah persiapan lahan, bedengan, mulsa dan ajir.</p><p>Seperti yang sudah kita ketahui, persiapan lahan sebaiknya dilakukan 2 minggu sebelum pindah tanam dilakukan. Hal ini dikarenakan ada beberapa komponen yang harus kita lakukan dalam persiapan lahan. Yang pertama adalah pengkondisian tanah dan media tanam dengan cara membersihkan lahan dari batu, bongkahan tanah dan gulma yang selanjutnya akan dicangkul atau dibajak sebanyak 2-3 kali agar tekstur dan aerasi tanah dapat terbangun dengan baik. Pada tanah yang telah dikondisikan dan diberikan pupuk dasar, pembuatan bedengan dengan lebar 1 meter dan ketinggian 20-30 cm tergantung pada musim tanam dapat dilakukan.</p><p>Pada bedengan yang sudah siap dan memiliki kelembaban yang cukup, mulsa dapat dipasang. Umumnya sekarang petani memilih penggunaan mulsa plastik yang lebih praktis dan tahan lama, bisa digunakan di musim apa pun. Namun ada juga alternatif penggunaan mulsa jerami yang lebih cocok dengan kondisi udara dan temperatur pada musim kemarau. Dalam pemasangan mulsa plastik maupun jerami, pastikan jarak antar lubang tanam tidak terlalu dekat, sehingga memberikan ruang bagi tanaman budidaya untuk bertumbuh dan berkembang.Â </p><p>Lain halnya pada pemasangan ajir yang dapat dilakukan sebelum atau segera setelah pindah tanam. Pemasangan ajir yang abik akan membantu dalam mengontrol hama penyakit tanaman serta memudahkan dalam proses panen. Ajir dapat membantu menopang tanaman dalam masa pertumbuhannya, sehingga memiliki struktur yang lebih kokoh. Dengan persiapan lahan, bedengan, mulsa dan ajir yang baik, tumbuh kembang tanaman dapat didukung secara optimal hingga masa panen nanti.</p><p><br></p><p>#IndonesiaKT #sipindo #sipindopoweredbysmartseeds #aplikasipertanian #petanimuda #petaniindonesia #tanaman #agriculture #persiapanlahan #lahanbudidaya #lahan #kebun #bedengan #mediatanam #ajir #pupuk #sayur #sayuran #farmlife</p>', '<p>Test</p>', 'Publish', 'Artikel', NULL, 'Persiapan Lahan, Bedengan, Mulsa, dan Ajir', 'whatsapp-image-2020-11-30-at-083320-1611724554.jpeg', NULL, NULL, NULL, NULL, NULL, '2020-09-16 01:31:45', '2020-09-16 01:30:55', '2021-05-06 02:10:32', '2021-05-06 02:10:32');

