INSERT INTO `faq` (`id_faq`, `pertanyaan`, `pertanyaan_en`, `jawaban`, `jawaban_en`, `tanggal`, `tanggal_diubah`, `id_user`) VALUES
(1, 'Cara daftar akun SIPINDO?', NULL, '<p>Pendaftaran dengan menggunakan nomor ponsel/email. Namun, hanya tersedia untuk nomor ponsel/email yang belum terdaftar. Kamu bisa ikuti langkah berikut untuk melakukan pendaftaran dengan nomor ponsel:\r\n</p><ul><li>\r\nKlik Daftar di pojok kanan atas beranda.</li><li>Masukkan Nomor Ponsel.\r\nKlik Daftar. Lalu pilih Ya, Benar jika nomor yang dimasukkan sudah sesuai.\r\n</li><li>Selanjutnya pilih Metode Verifikasi.\r\nMasukkan Kode Verifikasi yang dikirimkan melalui SMS/WhatsApp kamu.\r\n</li><li>Pendaftaran berhasil. </li><li>Kamu berhasil membuat akun.</li></ul>', NULL, '2021-02-23 05:38:40', '2021-02-23 05:38:40', 4),
(2, 'Apakah layanan SIPINDO berbayar?', NULL, 'Tidak. Sipindo Powered by SMARTseeds merupakan layanan freemium, artinya kami menyajikan layanan berbasis geodata yang dikemas secara premium namun secara GRATIS.<br>', NULL, '2021-02-23 05:38:48', '2021-02-23 05:38:48', 4),
(3, 'Kenapa tampilan Rekomendasi Pemupukan menampilkan angka 0?', NULL, '<p>Pada versi terakhir aplikasi SIPINDO, sumber data untuk layanan rekomendasi pemupukan masih berpusat pada area kerja Petugas Lapangan kami yang tersebar di area Pulau Jawa dan Lampung. Apabila kamu berada di luar wilayah tersebut, kemungkinan besar kamu akan mengalami tampilan Rekomendasi Pemupukan dengan angka 0 karena belum ada data dari daerahmu yang bisa kami olah.</p><p>Tim kami sedang bekerja untuk memperluas area sumber geodata SIPINDO agar bisa melayani lebih banyak #petanimilenial dan #pahlawanpangan di seluruh Indonesia. <br></p>', NULL, '2021-02-22 22:42:52', NULL, 4);

