INSERT INTO `konfigurasi` (`id_konfigurasi`, `namaweb`, `tagline`, `tagline2`, `deskripsi_singkat`, `deskripsi_lengkap`, `profil_lengkap`, `website`, `email`, `email_cadangan`, `alamat`, `telepon`, `hp`, `fax`, `logo`, `icon`, `keywords`, `metatext`, `facebook`, `twitter`, `instagram`, `youtube`, `nama_facebook`, `nama_twitter`, `nama_instagram`, `nama_youtube`, `google_map`, `link_googleplay`, `link_appstore`, `gambar`, `video`, `protocol`, `smtp_host`, `smtp_port`, `smtp_timeout`, `smtp_user`, `smtp_pass`, `link_bawah_peta`, `text_bawah_peta`, `id_user`, `tanggal`, `hero_title`, `hero_bg`, `hero_text`, `hero_link`, `hero_link_title`, `panduan_penggunaan`, `fitur_sipindo`, `smartseeds`, `smartseeds_deskripsi`, `smartseeds_fitur`, `smartseeds_gambar`, `supports`, `deskripsi_singkat_en`, `deskripsi_lengkap_en`, `profil_lengkap_en`, `hero_title_en`, `hero_text_en`, `hero_link_title_en`, `panduan_penggunaan_en`, `fitur_sipindo_en`, `smartseeds_deskripsi_en`, `smartseeds_fitur_en`) VALUES
(1, 'SIPINDO', 'Download Aplikasi Pertanian Terlengkap', 'Sipindo Powered By SMARTseeds', 'Sipindo salah satu aplikasi pertanian terbaik yang memberikan informasi pertanian dan membantu petani untuk mewujudkan kesejahteraan kepada para petani, download aplikasi pertaniannya sekarang.', '<h6 style=\"text-align: justify; \"><font color=\"#000000\"><span style=\"font-family: Verdana;\">Sipindo (Sistem Informasi Pertanian Indonesia) merupakan sebuah aplikasi pertanian berbasis android yang memberikan kemudahan akses informasi pertanian kepada petani di seluruh Indonesia. Tidak hanya itu, Sipindo juga memiliki misi untuk mensejahterakan dan meningkatkan taraf hidup para petani di Indonesia dengan cara menyediakan informasi mengenai teknik budidaya tanaman, hama penyakit tanaman, serta menyediakan akses pasar untuk kebutuhan jual beli hasil panen mereka.</span></font></h6>', '<p style=\"text-align: justify; \"><span style=\"font-family: \"Segoe UI\";\" verdana\";\"=\"\">Dalam upaya mewujudkan kemandirian pangan Indonesia, lompatan inovasi dan teknologi perlu dihadirkan di tengah pelaku sektor pertanian. Sipindo hadir dengan akses informasi pertanian bagi petani di seluruh Indonesia dalam upaya untuk meningkatkan kesejahteraan dan taraf hidup petani untuk mencapai hasil pertanian yang lebih optimal.</span><br></p><p style=\"text-align: justify; \"><span style=\"font-family: \" verdana\";\"=\"\">Berangkat dari keinginan kami untuk meningkatkan kesejahteraan petani Indonesia dan berkontribusi dalam mewujudkan kemandirian pangan bangsa, Sipindo yang memulai langkah pertamanya di tahun 2017 kini telah merangkul banyak pelaku sektor pertanian.</span><br></p><p style=\"text-align: justify; \"><span style=\"font-family: \" verdana\";\"=\"\">Sipindo merupakan aplikasi hasil kerjasama antara PT. East West Seed Indonesia (EWINDO) dengan AIP PRISMA. EWINDO adalah perusahaan benih sayuran terpadu pertama di Indonesia yang menghasilkan benih unggul sayuran melalui kegiatan pemuliaan tanaman. AIP PRISMA yaitu program dukungan Pemerintah Indonesia dan Australia untuk kemajuan pertanian Indonesia.</span></p><p style=\"text-align: justify;\"><span style=\"font-family: \" verdana\";\"=\"\">Dengan komitmen untuk terus berinovasi menghadirkan layanan-layanan terbaik untuk Petani Indonesia. EWINDO bekerjasama dalam Program SMARTseeds untuk menghadirkan layanan Premium yang dapat dengan mudah diakses olehÂ  Petani melalui Aplikasi Sipindo Powered by SMARTseeds. SMARTseeds adalah project Geodata for Agriculture and Water (G4AW) yang didanai oleh Netherlands Space Office (NSO) dan merupakan satu dari 17 projek di seluruh dunia. Program ini menggunakan prinsip PPP (Public Private Partnership) dimana terdiri dari 6 Lembaga yaitu ICCO Cooperation, EWINDO, Nelen and Schuurman, Twentee Universty (ITC), Akvo dan Institut Pertanian Bogor. Tujuan dari program ini adalah menghadirkan layanan informasi untuk 100.000 petani sayuran di Indonesia.</span></p><p style=\"text-align: justify;\"><span style=\"font-family: \" verdana\";\"=\"\">Sipindo Powered by SMARTseeds kini telah diunduh oleh lebih dari 80,000 pengguna di seluruh Indonesia, memberikan akses bagi ribuan petani kepada layanan informasi pertanian yang dapat diandalkan. Petani yang menggunakan layanan kami mengalami peningkatan produktivitas dan efisiensi penggunaan agri-input serta peningkatan akses alternatif ke pasar dan ahli pertanian.</span></p>', 'https://sipindo.id', 'admin@sipindo.id', 'admin@sipindo.id', '<p><b>PT BENIH ANUGRAH SEMPURNA\r\n</b></p><p>Jakarta Garden City Rukan Avenue No. 8-157 Jl. Raya Cakung Cilincing KM. 0,5 8 No. 157 Cakung Timur Cakung Jakarta Timur DKI Jakarta</p>', '085715100485', '+6281210697841', '081210697841', 'logo.png', 'favicon.png', 'sipindo, aplikasi pertanian', NULL, 'https://web.facebook.com/SipindoApps', NULL, 'https://www.instagram.com/sipindo.official/', 'https://www.youtube.com/channel/UCOmZk7UorxA4QfuPVLwPYmA/', 'Sipindo', '', 'sipindo.official', 'Sipindo Official', '<iframe src=\"https://www.google.com/maps/embed?pb=!1m14!1m8!1m3!1d7933.371714354556!2d106.96146200000001!3d-6.172798!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x0%3A0x14cb75e10f4ae7c6!2sBinatani%20-%20EWSI%20(Jakarta%20Office)!5e0!3m2!1sid!2sid!4v1611542051286!5m2!1sid!2sid\" width=\"600\" height=\"450\" frameborder=\"0\" style=\"border:0;\" allowfullscreen=\"\" aria-hidden=\"false\" tabindex=\"0\"></iframe>', 'https://play.google.com/store/apps/details?id=com.panahmerah.sipindo&hl=in&gl=US', NULL, 'mobile-sipindo.png', 'fsH_KhUWfho', 'smtp', 'ssl://mail.website.com', '465', '12', 'info@website.com', 'password', NULL, NULL, 90, '2021-08-11 10:03:45', 'SMARTseeds', 'hero-bg.jpg', 'Layanan sistem informasi pertanian bagi pengguna individu maupun bisnis', 'solusi-kami', 'Solusi Kami', '<h6 style=\"text-align: justify; \">Sipindo (Sistem Informasi Pertanian Indonesia) merupakan sebuah aplikasi pertanian berbasis android yang memberikan kemudahan akses informasi pertanian kepada petani di seluruh Indonesia.</h6>', '<h6 style=\"text-align: justify; \">Sipindo menyediakan layanan informasi freemium seputar pertanian melalui aplikasi Sipindo Powered by SMARTseeds. Layanan yang berbasis geodata ini dilengkapi dengan 11 fitur di antaranya Rekomendasi Pupuk dan Prediksi Cuaca Spesifik Lokasi, Kalkulator Pupuk, Rekomendasi Hama dan Penyakit Tanaman, Informasi Harga Sayuran, dan Jual Beli Sayuran Online.</h6><p><br></p>\r\n<a href=\"./teritorial-mapping\" class=\"btn btn-secondary btn-block\" title=\"\" alt=\"\">Pemetaan Penanaman per-Tanaman</a>\r\n<a href=\"./market-price\" class=\"btn btn-secondary btn-block\" title=\"\" alt=\"\">Harga Pasar</a>\r\n<a href=\"\" class=\"btn btn-secondary btn-block\" title=\"\" alt=\"\">Kalkulator Pupuk</a>', 'SMARTseeds B2B Dashboard', '<h6 style=\"text-align: justify; \">SMARTseeds Geodata Business Inteligence Dashboard adalah sebuah layanan\r\ninformasi bagi perusahaan dan/atau organisasi yang menyediakan insight data dan\r\ninformasi terkait rantai nilai komoditas sayuran di Indonesia. Berbagai info\r\ngeodata tersebut tersedia secara real-time dan dapat digunakan oleh berbagai\r\npelaku bisnis dan organisasi untuk mengambil keputusan berbasis data. Geodata\r\nyang tersedia di SMARTseeds merupakan integrasi berbagai jenis data dari beberapa\r\nsumber diantaranya data satelit, data kondisi tanah, data cuaca, data iklim,\r\ndata akses jalan, data harga komoditas, serta data yang diinput oleh petani\r\nmelalui aplikasi SIPINDO.</h6>', '<h6 style=\"text-align: justify; \">PETA IKLIM DAN CUACA</h6><h6 style=\"text-align: justify; \">Dengan\r\n menggunakan fitur peta iklim dan cuaca pengguna akan mendapatkan \r\ninformasi yang komprehensif tentang kondisi iklim dan cuaca di suatu \r\ndaerah, membandingkan perbedaan kondisi iklim dan cuaca antar daerah di \r\nIndonesia, mendapatkan informasi prediksi iklim dan cuaca, serta \r\nmengidentifikasi daerah dengan potensi iklim dan cuaca yang paling tepat\r\n untuk kegiatan usahanya. Data dan model prediksi iklim dan cuaca ini \r\nkami kembangkan bersama ahli dari Institut Pertanian Bogor (IPB) dan \r\ncuaca ini tersedia secara real-time. </h6><h6 style=\"text-align: justify; \"><br></h6><h6 style=\"text-align: justify; \">PETA PENANAMAN BERBASIS PENCITRAAN SATELIT</h6><h6 style=\"text-align: justify; \">Memanfaatkan\r\n teknologi pencitraan satelit, SMARTseeds Geodata Intelligence Dashboard\r\n menyediakan sebuah layanan informasi bagi pengguna untuk \r\nmengidentifikasi luasan pertanaman cabai, tomat, timun, dan jagung di \r\nsuatu daerah secara cepat tanpa perlu melakukan survei lapangan. \r\nTeknologi ini kami kembangkan bersama ahli dari universitas terkemuka di\r\n Belanda, ITC Twente, dan Indonesia, IPB University. Melalui fitur ini, \r\npengguna dapat memetakan luas pertanaman suatu komoditas dan \r\nmembandingkan luas pertanaman suatu komoditas di daerah satu dan \r\nlainnya.</h6><h6 style=\"text-align: justify; \"><br></h6><h6 style=\"text-align: justify; \">PETA INFORMASI HARGA KOMODITAS</h6><h6 style=\"text-align: justify; \">Dengan\r\n menggunakan fitur peta informasi harga komoditas, pengguna dapat \r\nmengetahui informasi sebaran data harga komoditas sayuran di seluruh \r\nIndonesia dari waktu ke waktu. Berdasar informasi ini, pengguna dapat \r\nmembuat keputusan berbasis data terkait prediksi tren harga komoditas \r\nsayuran di suatu daerah, membandingkan tren harga sayuran di satu daerah\r\n dengan daerah lainnya, dan membandingkan tren harga antar komoditas \r\nsayuran. Informasi harga ini kami ambil dari berbagai sumber dan \r\ntersedia secara real time.</h6><h6 style=\"text-align: justify; \"><br></h6><h6 style=\"text-align: justify; \">PETA AKSES JALAN</h6><h6 style=\"text-align: justify; \">Fitur\r\n peta akses jalan menyediakan layanan informasi geodata yang dapat \r\nmembantu pengguna dalam mengidentifikasi akses jalan di suatu daerah. \r\nInformasi ini akan mempermudah pengguna dalam menentukan daerah-daerah \r\nmana saja yang memiliki akses jalan untuk distribusi produk dengan cara \r\nmembandingkan panjang jalan, kelas jalan, dan aksesibilitas dari \r\nberbagai desa di Indonesia. Informasi akses jalan ini kami integrasikan \r\ndari berbagai sumber dan tersedia secara real-time.    </h6>', 'smartseeds1.png', NULL, NULL, '<p><span style=\"font-family: \"Verdana\";\">ï»¿</span><span style=\"font-family: \"Verdana\";\" verdana\";\"=\"\">ï»¿Sipindo (Sistem Informasi Pertanian Indonesia) is an android-based agricultural application that provides access to agricultural information to farmers throughout Indonesia. Not only that, Sipindo also has a mission to leverage and improve the lives of farmers in Indonesia by providing information on crop cultivation techniques, plant pests, and providing market access for their needs to buy and sell their crops.</span><br></p>', '<p>In an effort to realize Indonesia\'s food sovereignty, leaps in innovation and technology are needed within the agricultural sector. SIPINDO comes with access to agricultural information service for farmers throughout Indonesia in an effort to improve the welfare and livelihood of farmers to achieve more optimal agricultural output.</p><p>Starting off from our dream to improve the welfare of Indonesian farmers and contribute to realizing the nation\'s food sovereignty, SIPINDO, which started its first steps in 2017, has now embraced many actors in the<br>agricultural sector.</p><p>Sipindo is the fruit of a collaboration between PT. East West Seed Indonesia (EWINDO) with AIP PRISMA. EWINDO is the first integrated vegetable seed company in Indonesia to produce superior vegetable seeds through plant breeding activities. While AIP PRISMA the Australia-Indonesia Partnership for Promoting Rural Incomes through Support for Markets in Agriculture that in partnerships with the Indonesian government support the advancement of Indonesian agriculture.<br><br>With a commitment to continue to innovate to provide the best services for Indonesian Farmers. EWINDO joined the SMARTseeds Program to provide Premium services that can be easily accessed by farmers through the Sipindo Powered by SMARTseeds application. SMARTseeds is a Geodata for Agriculture and Water (G4AW) project funded by the Netherlands Space Office (NSO) and is one of 17 projects worldwide. This program uses the PPP (Public Private Partnership) principle, which consists of 6 institutions, namely ICCO Cooperation, EWINDO, Nelen and Schuurman, Twentee Universty (ITC), Akvo and Bogor Agricultural Institute. The aim of this program is to provide information services to 100,000 vegetable farmers in Indonesia.<br></p><p>Sipindo Powered by SMARTseeds has now been downloaded by more than 80,000 users across Indonesia, giving access to thousands of farmers to reliable information services. Farmers who are using our services have seen an increase in productivity, reduction in farming costs, and alternative access to market and agri-expertise.<br></p>', NULL, NULL, NULL, NULL, '<h6 style=\"text-align: justify; \">Sipindo provides freemium information service about agriculture through Sipindo Powered by SMARTseeds. This geodata-based service is equipped with 11 features, among others Location-Specific Fertilizer Advice and Weather Forecast, Fertilizer Calculator, Crop Diseases and Pests Advice, Vegetable Price Information, and Online Vegetable Marketplace.</h6><p><br></p>\r\n<a href=\"./teritorial-mapping\" class=\"btn btn-secondary btn-block\" title=\"\" alt=\"\">Crop Map</a>\r\n<a href=\"./market-price\" class=\"btn btn-secondary btn-block\" title=\"\" alt=\"\">Market Price</a>\r\n<a href=\"\" class=\"btn btn-secondary btn-block\" title=\"\" alt=\"\">Fertilizer Calculator</a>', NULL, NULL);

