(2, 4, 1, 'SMARTseeds B2B Dashboard', NULL, 'smartseeds-b2b-dashboard', NULL, 'SMARTseeds Geodata Business Inteligence Dashboard adalah sebuah layanan informasi bagi perusahaan dan/atau organisasi yang menyediakan insight data dan informasi terkait rantai nilai komoditas sayuran di Indonesia. Berbagai info geodata tersebut tersedia secara real-time dan dapat digunakan oleh berbagai pelaku bisnis dan organisasi untuk mengambil keputusan berbasis data. Geodata yang tersedia di SMARTseeds merupakan integrasi berbagai jenis data dari beberapa sumber diantaranya data satelit, data kondisi tanah, data cuaca, data iklim, data akses jalan, data harga komoditas, serta data yang diinput oleh petani melalui aplikasi SIPINDO.', NULL, 'Publish', 'Layanan', NULL, 'smartseeds1-1613195405.png', NULL, NULL, NULL, NULL, NULL, '2021-02-13 05:50:06', '2021-02-13 05:45:35', '2021-02-15 15:26:27', '0000-00-00 00:00:00');

