INSERT INTO `smartseeds` (`id_smartseeds`, `fitur`, `fitur_en`, `konten`, `konten_en`, `tanggal`, `tanggal_diubah`, `id_user`, `posisi`, `gambar`, `slug`) VALUES
(1, 'Layanan informasi SMARTseeds Geodata Intelligence Dashboard', NULL, 'SMARTseeds Geodata Business Inteligence Dashboard adalah sebuah layanan informasi bagi perusahaan dan/atau organisasi yang menyediakan insight data dan informasi terkait rantai nilai komoditas sayuran di Indonesia. Berbagai info geodata tersebut tersedia secara real-time dan dapat digunakan oleh berbagai pelaku bisnis dan organisasi untuk mengambil keputusan berbasis data. Geodata yang tersedia di SMARTseeds merupakan integrasi berbagai jenis data dari beberapa sumber diantaranya data satelit, data kondisi tanah, data cuaca, data iklim, data akses jalan, data harga komoditas, serta data yang diinput oleh petani melalui aplikasi SIPINDO.', NULL, '2021-02-16 02:47:39', '2021-02-16 02:47:39', 4, 'Kanan', 'smartseeds-1-1613441632.png', 'layanan-informasi-smartseeds-geodata-intelligence-dashboard'),
(2, 'Fitur Peta Informasi Iklim dan Cuaca di SMARTseeds Geodata Intelligence Dashboard', NULL, 'Dengan menggunakan fitur peta iklim dan cuaca pengguna akan mendapatkan informasi yang komprehensif tentang kondisi iklim dan cuaca di suatu daerah, membandingkan perbedaan kondisi iklim dan cuaca antar daerah di Indonesia, mendapatkan informasi prediksi iklim dan cuaca, serta mengidentifikasi daerah dengan potensi iklim dan cuaca yang paling tepat untuk kegiatan usahanya. Data dan model prediksi iklim dan cuaca ini kami kembangkan bersama ahli dari Institut Pertanian Bogor (IPB) dan cuaca ini tersedia secara real-time.', NULL, '2021-02-16 02:47:50', '2021-02-16 02:47:50', 4, 'Kiri', 'smartseeds-2-1613442897.png', 'fitur-peta-informasi-iklim-dan-cuaca-di-smartseeds-geodata-intelligence-dashboard'),
(3, 'Fitur Peta Penanaman Berbasis Pencitraan Satelit di SMARTseeds Geodata Intelligence Dashboard', NULL, 'Memanfaatkan teknologi pencitraan satelit, SMARTseeds Geodata Intelligence Dashboard menyediakan sebuah layanan informasi bagi pengguna untuk mengidentifikasi luasan pertanaman cabai, tomat, timun, dan jagung di suatu daerah secara cepat tanpa perlu melakukan survei lapangan. Teknologi ini kami kembangkan bersama ahli dari universitas terkemuka di Belanda, ITC Twente, dan Indonesia, IPB University. Melalui fitur ini, pengguna dapat memetakan luas pertanaman suatu komoditas dan membandingkan luas pertanaman suatu komoditas di daerah satu dan lainnya.', NULL, '2021-02-16 02:48:01', '2021-02-16 02:48:01', 4, 'Kanan', 'smartseeds-3-1613443061.png', 'fitur-peta-penanaman-berbasis-pencitraan-satelit-di-smartseeds-geodata-intelligence-dashboard'),
(4, 'Fitur Peta Profil Tanah di SMARTseeds Geodata Intelligence Dashboard', NULL, 'Fitur peta profil tanah menyediakan layanan informasi terkait kandungan nutrisi tanah di suatu daerah. Fitur ini kami kembangkan bersama ahli tanah dari IPB University. Dengan informasi ini, pengguna dapat memperkirakan potensi lahan di suatu daerah untuk penanaman suatu komoditas dan membuat keputusan terkait manajemen tanah yang harus dilakukan di lahan tersebut disesuaikan dengan kebutuhan dan karakteristik tanah.', NULL, '2021-02-16 02:48:09', '2021-02-16 02:48:09', 4, 'Kiri', 'smartseeds-4-1613443240.png', 'fitur-peta-profil-tanah-di-smartseeds-geodata-intelligence-dashboard'),
(5, 'Fitur Peta Informasi Harga Komoditas di SMARTseeds Geodata Intelligence Dashboard', NULL, 'Dengan menggunakan fitur peta informasi harga komoditas, pengguna dapat mengetahui informasi sebaran data harga komoditas sayuran di seluruh Indonesia dari waktu ke waktu. Berdasar informasi ini, pengguna dapat membuat keputusan berbasis data terkait prediksi tren harga komoditas sayuran di suatu daerah, membandingkan tren harga sayuran di satu daerah dengan daerah lainnya, dan membandingkan tren harga antar komoditas sayuran. Informasi harga ini kami ambil dari berbagai sumber dan tersedia secara real time.', NULL, '2021-02-16 02:48:15', '2021-02-16 02:48:15', 4, 'Kanan', 'smartseeds-5-1613443300.png', 'fitur-peta-informasi-harga-komoditas-di-smartseeds-geodata-intelligence-dashboard'),
(6, 'Fitur Peta Akses Jalan di SMARTseeds Geodata Intelligence Dashboard', NULL, 'Fitur peta akses jalan menyediakan layanan informasi geodata yang dapat membantu pengguna dalam mengidentifikasi akses jalan di suatu daerah. Informasi ini akan mempermudah pengguna dalam menentukan daerah-daerah mana saja yang memiliki akses jalan untuk distribusi produk dengan cara membandingkan panjang jalan, kelas jalan, dan aksesibilitas dari berbagai desa di Indonesia. Informasi akses jalan ini kami integrasikan dari berbagai sumber dan tersedia secara real-time.', NULL, '2021-02-16 02:48:22', '2021-02-16 02:48:22', 4, 'Kiri', 'smartseeds-6-1613443341.png', 'fitur-peta-akses-jalan-di-smartseeds-geodata-intelligence-dashboard');

